- input: "TEXT\x1CC00468447\x1C.TEXT\x1C\x1CF3XN\x1CAs per discussion w/FEC analyst,
    and as noted in prior period report:  (1) An individual donor (EDWARD PYERS) intended
    to donate $25 but accidentally hit the $5000 button.  A prompt refund in full
    to donor was previously issued for the excess amount by the online contribution
    processor.  Contribution processor is being reimbursed by PAC in this reporting
    period for the amount of the transaction received by PAC (the transaction fees
    received by processor were refunded to donor).  (2) PAC mistakenly donated $5000
    to candidate before realizing that the contribution limit was $2400 (PAC is not
    yet 6 months old and therefore not yet registered as a multi-candidate committee).
    \ Candidate committee refunded the amount in excess of the limit as requested.
    \ The error was discovered to late for the refund to be received in the prior
    reporting period.\n"
